Aechmea Fasciata is commonly known as the Silver Vase or Silver Urn plant and is native to tropical Brazil! This is a slow growing species eventually reaching 12-35 inches (30-90 cm) tall and wide with oval shaped leaves arranged in a rosette. This species does best in a fast draining soil mix and in partial shade as it's an epiphyte (a plant that grown on another plant) and an undercanopy species (a plant that grows below the canopy of dense forests) in its native habitat! When watering, aim to keep the vase or urn half way full of water! If fertilizing, spray from above so it'll fill the cup as well. This plant is probably the best known species in it's genus, and it is often grown as a houseplant in temperate areas or as a garden plant in warmer locations. This species can be grown outdoors year round in USDA Plant Hardiness Zones 10a-11, surviving to just below freezing temperatures for brief periods of time!

